    <h1>GIẢI THUẬT TÌM KIẾM</h1>
    <p>Tìm kiếm là một thao tác rất quan trọng đối với nhiều ứng dụng tin học. Tìm kiếm có thể định nghĩa là việc thu thập một số thông tin nào đó từ một khối thông tin lớn đã được lưu trữ trước đó. Thông tin khi lưu trữ thường được chia thành các bản ghi, mỗi bản ghi có một giá trị khóa để phục vụ cho mục đích tìm kiếm. Mục tiêu của việc tìm kiếm là tìm tấ cả các bản ghi có giá trị khóa trùng với một giá trị cho trước. Khi tìm được bản ghi này, các thông tin đi kèm trong bản ghi sẽ được thu thập và xử lý.</p>
    <p>Một ví dụ về ứng dụng thực tiễn của tìm kiếm là từ điển máy tính. Trong từ điển có rất nhiều mục từ, khóa của mỗi mục từ chính là cách viết tắt của từ. Thông tin đi kèm là định nghĩa của từ, cách phát ấm, các t");
